        public void ProblemTwo()
        {
            Dictionary<char, int> result = new Dictionary<char, int>();
            for (int i = 65; i < 91; i++)
            {
                char uper = (char)i;
                char lower = (char)(i + 32);
                result[uper] = ReactToCompletion(Input.Replace(uper.ToString(), "").Replace(lower.ToString(), "")).Length;
                //Console.WriteLine($"{uper}: {result[uper]}");
            }

            var res = result.Min(i => i.Value);
            Console.WriteLine(res);
        }
        
        private bool CanReact(char f, char s)
        {
            int first = (int)f;
            int second = (int)s;

            return first - second == 32 || second - first == 32;
        }

        private string ReactToCompletion(string input)
        {
            string output = "";
            while (React(input, out output))
            {
                input = output;
            }
            return output;
        }

        private bool React(string input, out string output)
        {
            bool hasReacted = false;
            output = "";
            for (int i = 0; i < input.Length; i++)
            {
                //Fetch last char
                if (i + 1 == input.Length)
                {
                    output += input[i];
                    continue;
                }

                if (!CanReact(input[i], input[i + 1]))
                {
                    output += input[i];
                }

                else
                {
                    hasReacted = true;
                    i++;
                }
            }
            return hasReacted;
        }

        private const string Example = "aBbAc";
        private const string Input = "";

    }
}